import React from 'react';

import {
  Container,
  DropdownInput,
  DatalistContainer,
  DropdownOption,
  InputContainer,
  Title,
} from './styles';

interface Props {
  title: string;
  placeholder?: string | undefined;
  width?: number;
  onChange?: (event: React.ChangeEvent) => void;
  onBlur?: (event: React.FocusEvent) => void;
  value?: string;
  errorMessage?: string;
  dataList?: Array<any>;
}

const InputDropdown: React.FC<Props> = ({
  width,
  title,
  placeholder,
  dataList,
}) => {
  return (
    <Container width={width}>
      <Title>{title}</Title>
      <DropdownInput placeholder={placeholder} />
      {dataList?.map(item => (
        <DropdownOption value={item}>{item}</DropdownOption>
      ))}
    </Container>
  );
};

export default InputDropdown;
